import React from "react";
import TextField from '@material-ui/core/TextField';
import "./twitterResults.css"

const TwitterResults = (props) => {

    const determineValue = (results) => {
        if (results !== null) {
            return results
        } else {
            return "Click Submit to see results!"
        }
    }
    //{props.results != null ? props.result : <p>Click Submit to see results!</p>}
    return (
        <TextField
            id="standard-textarea"
            label="Multiline Placeholder"
            placeholder="Results"
            multiline
            value={determineValue(props.results)}
        />



    )
}

export default TwitterResults;
